import tkinter as tk
from PIL import Image, ImageTk, ImageSequence
import base64
import io

# -----------------------------
# Icon PNG Base
# -----------------------------

icon_b64 = """

 """

# -----------------------------
# Tkinter setup
# -----------------------------
root = tk.Tk()
root.title("Your Totally ""Real"" game!")
root.configure(bg="#191919")
root.geometry("400x250")
icon_bytes = base64.b64decode(icon_b64)
icon_image = tk.PhotoImage(data=icon_bytes)
root.iconphoto(True, icon_image)
root.resizable(False, False)
# -----------------------------
# Embedded GIF as base64
# -----------------------------
gif_b64 = """

"""  # replace this with your actual base64 string

gif_bytes = base64.b64decode(gif_b64)
img = Image.open(io.BytesIO(gif_bytes))

# Extract frames
frames = [ImageTk.PhotoImage(frame.copy().convert("RGBA"))
          for frame in ImageSequence.Iterator(img)]

# -----------------------------
# GIF Label
# -----------------------------
label = tk.Label(root, bg="#19191d")
label.pack(pady=10)

# -----------------------------
# Animation loop
# -----------------------------


def animate(index=0):
    frame = frames[index]
    label.config(image=frame)
    index = (index + 1) % len(frames)
    root.after(img.info.get('duration', 100), animate, index)


animate()

# -----------------------------
# Quit button
# -----------------------------
quit_btn = tk.Button(root, text="Quit", command=root.destroy,
                     bg="#ff5555", fg="white", font=("Arial", 12, "bold"),
                     activebackground="#ff7777", activeforeground="white")
quit_btn.pack(pady=10)

# -----------------------------
# Run app
# -----------------------------
root.mainloop()
